import {UseFetch} from "../Hooks/index"
export const ReducersStore = (state,action) =>{
    switch (action.type) {
        case "API_REQUEST":
            (async()=>{
                await console.log(action.payload)
            })()

            break;

        default:
            return state;
    }
}
